import React, { useState, useEffect } from 'react'
import ImgCarousel from './ImgCarousel';
import DisplayInfo from './DisplayInfo';


export default function ListCabins (props) {
    const [cabins, setCabins] = useState([]);
    useEffect(() => {
        fetch('/cabins')
            .then(response => response.json())
            .then(json => {
                setCabins(json);
            })
            .catch(error => console.log(error)); 
    }, []);
    return (
        <div>
            {
                cabins.map(cabin => {
                    const {
                        name, description, id, 
                        totalPrice, askingPrice, expenses, 
                        primaryRoomArea, livableArea, grossArea,
                        aditionalInfo,
                        img1, img2, img3,
                        createdOn
                    } = cabins;
                    return (
                        <div key={id}>
                            <img src={img1} alt='Image og cabin'/>
                            <h2>{name}</h2>
                        </div>
                    )
                })
            }
            <p>Hello from ListCabins</p>
            <ImgCarousel />
            <DisplayInfo />
        </div>
    )
}
